import React, { useState } from 'react';
import './App.css';
import { Item } from './types/item';
import { ListContainer } from './components/List/List';

function App() { 

  const [todos, setTodoes] = useState<Item[]>([
    {
      id: 1, text: 'Learn Typescript', completed: false
    }
  ])

  return (
    <div className='main-container'>
      <div className='title'>Daily To-Do List</div>

      <ul>
            {todos.map((todo) => (
                <li>{todo.text}</li>
            ))}
        </ul>

      <ListContainer id={0} text={''} completed={false} />
      <button>Add</button>
    </div>
  );
}

export default App;
